import Sequelize from 'sequelize'; // clase Sequelize
import { sequelize } from '../database/database' //conexion a la base
import Persona from './Persona'

export const Jugador = sequelize.define('Jugador', {
        dni: {
            type: Sequelize.TEXT,
            primarykey: true

        },
        legajo: {
            type: Sequelize.TEXT
        },
        facultad: {
            type: Sequelize.TEXT
        }
    }, {
        timestamps: false
    }

);

Jugador.hasOne(Persona, { foreingKey: 'dni', sourceKey: 'dni' })
